local this = UIComponent(Address)
function Select(sel) if sel then this:SetState("selected") this:StealShortcutKey(true) else this:SetState("unselected") this:StealShortcutKey(false)
end end

function NotifySelected()
	Component.Call("Parent.LuaCall", "Notify", Component.Messages.StateChange, Component.Call("CurrentState"), Address)
end

function SetState(state)
	Component.SetState(state)
end
